var assert = require("assert");
var sinon = require("sinon");
var Behaviors = require("../lib/behaviors.js");
var Convert = require("leanft.sdk.core").Convert;

describe("CheckedDescriptionBehavior ",function() {
    var CheckedDescBehavior = Behaviors.CheckedDescriptionBehavior;
    var checkedDescBehaviorUnderTest;

    beforeEach(function () {
        checkedDescBehaviorUnderTest = CheckedDescBehavior;
        checkedDescBehaviorUnderTest._propertyHandler = sinon.stub();
    });

    afterEach(function(){
        delete checkedDescBehaviorUnderTest._propertyHandler;
    });

    describe("isCheckable method",function() {
        it("should call _propertyHandler and pass it the correct arguments",function(){
            checkedDescBehaviorUnderTest.isCheckable(true);
            assert(checkedDescBehaviorUnderTest._propertyHandler.calledOnce);
            assert.deepEqual(checkedDescBehaviorUnderTest._propertyHandler.firstCall.args, ["isCheckable", true, Convert.toBool]);
        });
        it("should return the same promise that was returned from _propertyHandler",function(){
            var getROPromise = {};
            checkedDescBehaviorUnderTest._propertyHandler.returns(getROPromise);
            var res = checkedDescBehaviorUnderTest.isCheckable(true);
            assert.strictEqual(res,getROPromise);
        });
    });

    describe("isChecked method",function() {
        it("should call _propertyHandler and pass it the correct arguments",function(){
            checkedDescBehaviorUnderTest.isChecked(true);
            assert(checkedDescBehaviorUnderTest._propertyHandler.calledOnce);
            assert.deepEqual(checkedDescBehaviorUnderTest._propertyHandler.firstCall.args, ["isChecked", true, Convert.toBool]);
        });
        it("should return the same promise that was returned from _propertyHandler",function(){
            var getROPromise = {};
            checkedDescBehaviorUnderTest._propertyHandler.returns(getROPromise);
            var res = checkedDescBehaviorUnderTest.isChecked(true);
            assert.strictEqual(res,getROPromise);
        });
    });

});

